* {
    box-sizing: border-box;
}

body {
    height: 100vh;
    margin: 0;
    color: #646C79;
    height: 100vh;
    font-family: 'Open Sans', sans-serif;
}

p {
    font-size: 16pt;
    font-weight: lighter;
}


/* MAIN SECTION  */

#main-background {
    height: 100vh;
    background-image: url(img/Lux-city.jpg);
    background-size: cover;
    background-position: top;
}

#main-background .main-title h1 {
    color: black;
    background-color: white;
    opacity: 0.28;
    font-size: 3.8em;
}

#main-background .main-title h2 {
    color: white;
    background-color: black;
    opacity: 0.7;
    text-align: center;
}

#main-background .navbloc {
    color: white;
}

.navbloc {
    position: absolute;
}

.nav-link {
    color: rgb(68, 68, 68) !important;
    font-weight: 600;
}



/********** section 1 **************/

.section-who {
    padding-top: 30px;
}

.intro {
    line-height: 1.2em;
}

.intro h1 {
    font-size: 3.2rem;
    color: black;
    letter-spacing: -0.07em;
}

.intro .intro-upper-p {
    font-size: 1.3em;
    padding-bottom: 10px;
}

.section-who img {
    position: relative;
    width: 100%;
    height: 400px;
    object-fit: cover;
    filter: grayscale(100%);
    box-shadow: 0 2px 3px rgba(0, 0, 0, 0.16), 0 2px 3px rgba(0, 0, 0, 0.23);
    margin-bottom: 10px;
}

.section-who img:hover {
    opacity: 1;
    -webkit-filter: none !important;
    filter: none !important;
    cursor: pointer;
}

.section-who .intro-down-p {
    position: absolute;
    font-size: 0.9em;
    font-weight: 500;
    padding: 25px;
    background-color: #E5E5E5;
    opacity: 0.9;
    text-align: left;
    position: relative;
    top: -40px;
    right: -25px;
    -webkit-box-shadow: inset 0px 0px 5px -1px rgb(105, 105, 105);
    box-shadow: inset 0px 0px 5px -1px lightgray;
}

/* 
========================
      BUTTON ONE
========================
*/

.btn-one {
    color: #FFF;
    transition: all 0.3s;
    bottom: 0;
    position: relative;
    display: inline-block;
}

.btn-one span {
    transition: all 0.3s;
}

.btn-one::before {
    content: '';
    position: absolute;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 1;
    opacity: 0;
    transition: all 0.3s;
    border-top-width: 1px;
    border-bottom-width: 1px;
    border-top-style: solid;
    border-bottom-style: solid;
    border-top-color: red;
    border-bottom-color: red;
    transform: scale(0.1, 1);
}

.btn-one:hover span {
    letter-spacing: 2px;
}

.btn-one:hover::before {
    opacity: 1;
    transform: scale(1, 1);
}

.btn-one::after {
    content: '';
    position: absolute;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 1;
    transition: all 0.3s;
    background-color: rgba(255, 255, 255, 0.1);
}

.btn-one:hover::after {
    opacity: 0;
    transform: scale(0.1, 1);
}







/* QUOTATION MARK*/
#quotation {
    position: relative;
    background-color: #fafafa;
    color: #646c79;
    margin-bottom: 40px;
    margin-top: 30px;
    padding: 30px;
    border: solid 1px transparent;
    border-radius: 10px;
    transition: .5s ease;
    backface-visibility: hidden;
    font-weight: 500;
}

#quotation-title {
    position: absolute;
    top: 0;
    right: 0;
    color: black;
}

#quotation-title h2 {
    font-size: 1.4em;
    background-color: rgb(241, 241, 241);
    border-radius: 8px;
    padding: 5px 10px;
    position: relative;
    top: 5px;
    right: -20px;
    -moz-transform: rotate(33deg);
    -webkit-transform: rotate(33deg);
    -o-transform: rotate(33deg);
    -ms-transform: rotate(33deg);
    transform: rotate(33deg);
}

#quotation:hover {
    opacity: 0.8;
}

#quotation:hover .middle {
    opacity: 1;
}

#quotation .sign {
    color: black;
    font-weight: 400;
}

.fa-quote-left {
    padding-bottom: 10px;
}

.fa-quote-right {
    float: right;
    padding-top: 10px;
}

.middle {
    transition: .5s ease;
    opacity: 0;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    -ms-transform: translate(-50%, -50%)
}

.text {
    background-color: #282f40;
    color: white;
    font-size: 16px;
    padding: 16px 32px;
    cursor: pointer;
    text-decoration: none;
}

.text a {
    color: inherit;
}


/* 
SECTION WHAT I DO  */

